import styled from 'styled-components';

const InfoBox = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-around;
`

const Text = styled.span`
  font-size : 20px;
  flex-grow : 2;
`;

const Myimg = styled.span`
    background: black;
    width: 280px;
    height: 280px;
    flex-grouw : 1;
`;

function MyPage1() {
    return (
        <InfoBox>
            <span>
                <Text>이름 <br /><br /></Text>
                <Text>핸드폰 <br /><br /></Text>
                <Text>이메일 <br /><br /></Text>
            </span>
                <Myimg />
        </InfoBox>
    )
}

export default MyPage1
